import React, { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [gloves, setGloves] = useState<any>(null);

  const fetchGloves = async () => {
    const res = await fetch('http://example.com/movies.json');
    res.json();
    setGloves(res);
  }


  useEffect(() => {
    fetchGloves();
  }, []);

  return (
    <div className="App">
      <div className="content">
        <div>{'Gloves'}</div>
        <div>{'Beanies'}</div>
        <div>{'Face masks'}</div>
      </div>
    </div>
  );
}

export default App;
